question.onEnterAssignment:
areas = queryMasterData($masterdata:'felocations', 'area', {}, { "result":"all"; });  
areaList = {};
for (int : areas)
{
    areaList[int] = areas[int]['data']['Area'];
}
addAnswers($answer:'#3_1', areaList);

fireExtLocations = queryMasterData($masterdata:'felocations', 'felocations', {}, { "result":"all"; });  
felocs = {};
for (int : fireExtLocations)
{
    felocs[int] = fireExtLocations[int]['data']['LocationName'];
}
addAnswers($answer:'#4_1', felocs);
